import React, {Component} from 'react';

class InformationComplaints extends Component {
    render() {
        return (
            <div className="w-100 text-center mt-30">
                <section id="information-complaints">
                    <h2 className="complaint-title">Shikoyatlar mavjudmi?
                        Onlayn tarzda yuboring</h2>
                    <img src="../icons/my-gov-uz-2.png" alt=""/>
                    <h3 className="interactive-service mb-0">Davlat interaktiv</h3>
                    <h3 className="interactive-service mb-0">xizmatlari yagona portali</h3>

                </section>
            </div>
        );
    }
}

export default InformationComplaints;
